import React from "react";
import "./styles/footer.css";

function Footer() {
  return (
    <footer class="footer">
      <div class="container">
        <span class="text-muted">
          Prueba Test Front End Developer | Diego Betancourt 2020
        </span>
      </div>
    </footer>
  );
}

export default Footer;
